import React, { Component } from "react";
import addBookClub from "../../components/addBookClub";
import Wrapper from "../../components/Wrapper";

class BookClub extends Component {
  render() {
    return (
      <div>
        <hr />
        <hr />
        <hr />

      <Wrapper>
        <addBookClub />
      </Wrapper>
      </div>
    );
  }
}

export default BookClub;
